d = dict()
s = 11
p = ''
q = ''
l = len(p)

def solve(mid):
	for i in range(mid,l+1):
		for j in range(mid,l+1):
			tmp = d[i][j]-d[i-mid][j-mid]
			if tmp<=s:
				return True
	return False

for i in range(l+1):
	d[i] = dict()
	d[0][i] = 0
	d[i][0] = 0
# print(d)

for i in range(l):
	for j in range(l):
		if p[i] == q[j] :
			d[i+1][j+1] = d[i][j]
		else:
			d[i+1][j+1] = d[i][j]+1

low,high = 0,l

while(low<high):
	mid = (low+high+1)//2
	if(solve(mid)): low = mid
	else: high = mid-1

# print(d)
print(low)